import React from 'react';

export const Form = ({ userInput }) => {

    const handleChange = (event) => {
        onFormChange(event.target.value)
    }
    return(
    <>
        <form>
            <input type='text' required value={userInput} onChange={handleChange}></input>
            <input type='submit'></input>
        </form>
    </>
    )
}
